import React from 'react';
import PlantCard from './PlantCard';

const samplePlants = [
  {
    id: 1,
    name: 'Aloe Vera',
    description: 'A succulent plant species of the genus Aloe.',
    image: 'https://via.placeholder.com/150?text=Aloe+Vera',
  },
  {
    id: 2,
    name: 'Snake Plant',
    description: 'A species of flowering plant in the family Asparagaceae.',
    image: 'https://via.placeholder.com/150?text=Snake+Plant',
  },
  {
    id: 3,
    name: 'Spider Plant',
    description: 'A species of perennial flowering plant.',
    image: 'https://via.placeholder.com/150?text=Spider+Plant',
  },
];

const PlantList = () => {
  return (
    <div style={styles.list}>
      <h2>Plant List</h2>
      <div style={styles.grid}>
        {samplePlants.map((plant) => (
          <PlantCard key={plant.id} plant={plant} />
        ))}
      </div>
    </div>
  );
};

const styles = {
  list: {
    padding: '20px',
  },
  grid: {
    display: 'flex',
    flexWrap: 'wrap',
    justifyContent: 'flex-start',
  },
};

export default PlantList;
